import React from 'react';
import style from './TripList.module.css';
import tripListData from './TripListData.js'

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';



export default function CenteredGrid() {

  return (   
    <>
    {tripListData.map(item => (
       <div >
         <Grid container spacing={1} className={style.mainGridContainer}>
            <Grid item xs={12} sm={6}>
              <Paper className={style.paper}>
                <Grid className={style.singleRow}>{item.name}</Grid>
              </Paper>
            </Grid>
            <Grid item xs={12} sm={6}>
              <Paper  className={style.paper}>
                <Grid className={style.singleRow}>Trip for: {item.numberOfPeople}</Grid>
                <Grid className={style.singleRow}>In: {item.seasonTime} </Grid>
                <Grid className={style.singleRow}>{item.tripLength} </Grid>
              </Paper>
            </Grid>
          </Grid>
        </div>
    ))} 
  </>  
  );
}
